import React, { FC } from "react";

export interface NcPlayIconProps {
  className?: string;
  svgClass?: string;
}

const NcPlayIcon: FC<NcPlayIconProps> = ({
  className = "w-20 h-20 p-3 lg:w-52 lg:h-52 lg:p-12",
  svgClass = "w-8 h-8 md:w-12 md:h-12",
}) => {
  return (
    <div
      className={`nc-NcPlayIcon bg-white bg-opacity-30 backdrop-filter backdrop-blur rounded-full  ${className}`}
      data-nc-id="NcPlayIcon"
    >
      <div className="w-full h-full bg-white rounded-full text-primary-500 relative">
        <span className="absolute inset-0 flex items-center justify-center">
          <svg
            className={svgClass}
            width="24"
            height="24"
            fill="currentColor"
            viewBox="0 0 24 24"
          >
            <path
              stroke="currentColor"
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth="1.5"
              d="M18.25 12L5.75 5.75V18.25L18.25 12Z"
            ></path>
          </svg>
        </span>
      </div>
    </div>
  );
};

export default NcPlayIcon;
